import React from "react";
import { useState } from "react";

const Square = (handleOnClick) => {
  const [value, setValue] = useState(3);
  return (
    <div>
      <h4 onClick={(value) => setValue(value)}>{value}</h4>
    </div>
  );
};

export default Square;
